import React, { useState } from "react";
import Axios from "axios";


function Test() {


    const [emailConf, setEmailConf] = useState("samiksha.zomin@gmail.com");
    const [passwordConf, setPasswordConf] = useState("10@J");

    Axios.defaults.withCredentials = true;
        //LogIn Form
        const login = (event) => {

            if(emailConf && passwordConf) {
                Axios.post("http://localhost:3001/testsession/login", {
                    email: emailConf,
                    password: passwordConf
                })
                .then((response) => {
                    localStorage.setItem("token", response.data.token)

                });
            }
            event.preventDefault();
            setEmailConf("");
            setPasswordConf("");
            console.log("sending");
        };


  return (
    <div className="testse">
      <div>
        <input
          type="email"
          required
          name="email"
          placeholder="Email Address"
          value={emailConf}
          onChange={(e) => {
            setEmailConf(e.target.value);
          }}
        />
      </div>
      <div>
        <input
          type="password"
          required
          name="password"
          placeholder="Password"
          value={passwordConf}
          onChange={(e) => {
            setPasswordConf(e.target.value);
          }}
        />
      </div>

      <div>
      <input type="submit" value="Submit" onClick={login} />
      </div>
    </div>
  );
}

export default Test;
